import * as React from 'react';
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';
import SendIcon from '@mui/icons-material/Send';
import Stack from '@mui/material/Stack';

export default function sidebar() {
    return (
      <div style={{ position: 'fixed', left: 0, top: 0, height: '100%', backgroundColor: 'black' , width: 159}}>
        <Stack spacing={2} direction="column">
          <Button href="/user" variant="text" startIcon={<DeleteIcon />} style={{ position: 'fixed', left: 0, top: 0, height: '100%', backgroundColor: 'black' , width: 159}}>
            Delete
          </Button>
          <Button variant="text" endIcon={<SendIcon />}>
            Send
          </Button>
          <Button >Page 3</Button>
        </Stack>
      </div>
    );
  }
